import React from "react";
import { MDBContainer, MDBRow, MDBCol, MDBBtn, MDBIcon } from 'mdbreact';

class Signin extends React.Component{

  constructor(props){
    super(props);
    this.state = {
      signInName: '',
      signInEmail: '',
      signInIssue: ''
    }

  }

  onNameChange = (event) => {
    this.setState({signInName: event.target.value})
  }

  onEmailChange = (event) => {
    this.setState({signInEmail: event.target.value})
  }

  onIssueChange = (event) => {
    this.setState({signInIssue: event.target.value})
  }

  onSubmitSignin = () =>{
    console.log(this.state);
  }


  render(){
    const {onInputChange, onSubmit} = this.props;
    return (

    <MDBContainer className="ml-3">
      <MDBRow>
        <MDBCol md="2">
        </MDBCol>
        <MDBCol md="8">
          <form>
            <p className="h4 text-center mb-4">IT Walk-In</p>
            <label htmlFor="defaultFormContactNameEx" className="grey-text">
              Name
            </label>
            <input
              type="text"
              id="defaultFormContactNameEx"
              className="form-control"
              onChange={onInputChange}
            />
            <br />
            <label htmlFor="defaultFormContactEmailEx" className="grey-text">
              Email
            </label>
            <input
              type="email"
              id="defaultFormContactEmailEx"
              className="form-control"
              onChange={onInputChange}
            />
            <br />

            <br />
            <label
              htmlFor="defaultFormContactMessageEx"
              className="grey-text"
            >
              Describe Your Issue
            </label>
            <textarea
              type="text"
              id="defaultFormContactMessageEx"
              className="form-control"
              rows="3"
              onChange={onInputChange}
            />
            <div className="text-center mt-4">
              <MDBBtn color="warning" outline type="submit" onClick={onSubmit}>
                Send
                <MDBIcon far icon="paper-plane" className="ml-2" />
              </MDBBtn>
            </div>
          </form>
        </MDBCol>
      </MDBRow>
    </MDBContainer>
  );
  }

};

export default Signin;
